# coding=utf-8
import time
import unittest

from alas_ce0.management.employee import EmployeeClient

from alas_ce0.management.roles_group import RolesGroupClient

from alas_ce0.management.role import RoleClient

from alas_ce0.management.feature import FeatureClient

from alas_ce0.management.resource import ResourceClient

from alas_ce0.management.user import UserClient
from config import API_ACCESS_CONFIG


class TestUserApi(unittest.TestCase):
    def test_crud(self):
        # Tests Setup

        resource_client = ResourceClient(**API_ACCESS_CONFIG)
        resource = {
            'description': 'TestResource',
            'target': '/target'
        }

        result = resource_client.create(resource)
        self.assertTrue(result.response.status == 200 and result.content)
        time.sleep(0.5)
        resource_id = result.content['resource_id']

        feature_client = FeatureClient(**API_ACCESS_CONFIG)
        feature = {
            'name': 'TestFeature',
            'description': 'TestFeature',
            'resources': [resource_id]
        }

        result = feature_client.create(feature)
        self.assertTrue(result.response.status == 200 and result.content)
        time.sleep(0.5)

        role_client = RoleClient(**API_ACCESS_CONFIG)
        role = {
            'name': 'TestRole',
            'description': 'TestRole',
            'features': ["TestFeature"]
        }

        result = role_client.create(role)
        self.assertTrue(result.response.status == 200 and result.content)
        time.sleep(0.5)

        roles_group_client = RolesGroupClient(**API_ACCESS_CONFIG)
        roles_group = {
            'name': 'TestRolesGroup',
            'description': 'TestRolesGroup',
            'roles': ["TestRole"]
        }

        result = roles_group_client.create(roles_group)
        self.assertTrue(result.response.status == 200 and result.content)
        time.sleep(0.5)

        employee_client = EmployeeClient(**API_ACCESS_CONFIG)
        employee = {
            'code': '22222222-2',
            'first_name': 'First Nam',
            'last_name': 'Last Name',
            'birth_date': '1991-01-01',
            'gender': 1,
            'internal_code': '1',
            'status': 1
        }

        result = employee_client.create(employee)
        self.assertTrue(result.response.status == 200 and result.content)
        time.sleep(0.5)

        # User Tests

        user_client = UserClient(**API_ACCESS_CONFIG)
        user = {
            'user_name': 'test',
            'password': '123456',
            'status': 1,
            'email': 'est@alas.cl',
            'roles_group': "TestRolesGroup",
            'employee': "22222222-2",
            'profile': {
                'photo': ''
            }
        }

        result = user_client.create(user)
        self.assertTrue(result.response.status == 200 and result.content)
        time.sleep(0.5)

        result = user_client.get_by_id(result.content['user_name'])
        self.assertTrue(result.response.status == 200 and result.content)
        time.sleep(0.5)

        result = user_client.get_by_id('sampleuser')
        self.assertTrue(result.response.status == 404)
        time.sleep(0.5)

        result = user_client.search({'email': 'est@alas.cl'})
        self.assertTrue(result.response.status == 200 and result.content)
        time.sleep(0.5)

        result = user_client.delete(result.content['items'][0]['user_name'])
        self.assertTrue(result.response.status == 204)
        time.sleep(0.5)

        result = user_client.create(user)
        self.assertTrue(result.response.status == 200 and result.content)
        time.sleep(0.5)

        user['email'] = 't' + user['email']
        result = user_client.update(user, result.content['user_name'])
        self.assertTrue(result.response.status == 200 and result.content)
        time.sleep(0.5)

        result = user_client.authenticate(user['user_name'], '123456')
        self.assertTrue(result.response.status == 200 and result.content)
        time.sleep(0.5)

        result = user_client.authenticate(user['user_name'], '888888')
        self.assertTrue(result.response.status == 401)
        time.sleep(0.5)

        result = user_client.reset_password(user['user_name'], '222222')
        self.assertTrue(result.response.status == 200 and result.content)
        time.sleep(0.5)

        result = user_client.authenticate(user['user_name'], '222222')
        self.assertTrue(result.response.status == 200 and result.content)
        time.sleep(0.5)

        result = user_client.delete('test')
        self.assertTrue(result.response.status == 204)
        time.sleep(1)

        # Tests Cleanup

        result = roles_group_client.delete('TestRolesGroup')
        self.assertTrue(result.response.status == 204)
        time.sleep(1)

        result = role_client.delete('TestRole')
        self.assertTrue(result.response.status == 204)
        time.sleep(1)

        result = feature_client.delete('TestFeature')
        self.assertTrue(result.response.status == 204)
        time.sleep(1)

        result = resource_client.delete(resource_id)
        self.assertTrue(result.response.status == 204)
        time.sleep(1)

        result = employee_client.delete("22222222-2")
        self.assertTrue(result.response.status == 204)
        time.sleep(1)


if __name__ == '__main__':
    unittest.main()
